            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Les informations financières et de gestion jouent un rôle déterminant dans les processus de gestion des organisations et trouvent, pour la plupart,
                    leur origine dans les activités de l'entreprise. Parmi ces informations, celles qui sont exprimées en termes monétaires permettent une évaluation
                    synthétique de la situation financière et des performances de l'entreprise et prennent leur place dans les processus de prise de décision et d'analyse
                    prévisionnelle. Le programme prend appui sur les enseignements des programmes de spécialité ");
