                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    La formation assurée dans la filière Finance-Comptabilité a pour finalité de préparer les étudiants aux métiers de la comptabilité, de la finance et
                    du contrôle, que ceux-ci soient exercés en entreprise ou en cabinet d’expertise comptable et d’audit. Aussi dispense-t-elle un enseignement
                    intensif en Sciences de Gestion, et plus spécifiquement dans le domaine de la Comptabilité, de la Finance et du Droit de l’entreprise.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
");
